import React from 'react';
import axios from 'axios'

class App extends React.Component{
render(){
  componentDidMount = () =>{
    this.getBlogPost()
  }
  getBlogPost = () =>{
    axios.get('/api') 
    .the((response) =>{
      const data = response.data;
      this.setState({posts: data})
      console.log("Data has been recieved");
    })
    .catch(() =>{
      alert('Error retriving data');
    });
  }

}
}
// export default App
